import React, { Component, useState } from "react";
import { VictoryLine, VictoryChart, VictoryAxis } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    this.state = {
        data: [
            {x: "Dec 31", y: 177.57},
            {x: "Jan 3", y: 182.01},
            {x: "Jan 4", y: 179.7},
            {x: "Jan 5", y: 174.92},
            {x: "Jan 6", y: 172},
            {x: "Jan 7", y: 172.17},
            {x: "Jan 10", y: 172.19},
            {x: "Jan 11", y: 175.08},
            {x: "Jan 12", y: 175.53},
            {x: "Jan 13", y: 172.19},
            {x: "Jan 14", y: 173.07},
            {x: "Jan 18", y: 169.8},
            {x: "Jan 19", y: 166.23},
            {x: "Jan 20", y: 164.51},
            {x: "Jan 21", y: 162.41},
            {x: "Jan 24", y: 161.62},
            {x: "Jan 25", y: 159.78},
            {x: "Jan 26", y: 159.69},
            {x: "Jan 27", y: 159.22},
            {x: "Jan 28", y: 170.33},
        ]
      };
    // console.log(chart)
    }
    // componentDidMount() {
    //     this.setState({data: compHistory("AAPL", 1)})
    // }
  render() {
      console.log(this.state.data)
    return (
      <div>
        <h1>Apple Stock Prices Past Month</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            // domainPadding={{ x: 100 }}
            fixLabelOverlap={true}
            style={{
              data: {
                stroke: "#02B875",
                ticks: {stroke: "grey", size: 1}
              }
            }}
          />
          <VictoryAxis 
            tickCount={5}
            ickValues={["Dec 31", "Jan 7", "Jan 14", "Jan 24", "Jan 24"]}
            label = "Date"
            />
        </VictoryChart>
      </div>
    );
  }
}
